import "./App.css";
import React from "react";
import ListEmployeeComponent from "./components/ListEmployeeComponent";
import HeaderComponents from "./components/HeaderComponent";
import FooterComponent from "./components/FooterComponents";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import CreateEmployeeComponenet from "./components/CreateEmployeeComponenet";

function App() {
  return (
    <BrowserRouter>
      <HeaderComponents />
      <div className="container">
        <Routes>
          <Route
            path="/"
            element={<ListEmployeeComponent />}
            className="container"
          />
          <Route
            path="/employees"
            element={<ListEmployeeComponent />}
            className="container"
          />
          <Route
            path="/add-employee"
            element={<CreateEmployeeComponenet />}
            className="container"
          />
        </Routes>
      </div>
      <FooterComponent />
    </BrowserRouter>
  );
}

export default App;
